import React, { useEffect } from 'react';
// import PropTypes from 'prop-types'
import bg from '../images/bg.jpg';
import bg1 from '../images/bg1.jpg';
import './style.css';
import Typed from "typed.js";
// import "https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js";
// import "https://cdnjs.cloudflare.com/ajax/libs/typed.js/1.1.7/typed.min.js";
// import "https://unpkg.com/typed.js@2.1.0/dist/typed.umd.js";

const Home = props => {
    const el = useRef(null);

    useEffect(() => {
        const typed = new Typed(el.current, {
          strings: ["Handy", "Mandy", "Candy", "More Strings"], // Strings to display
          // Speed settings, try diffrent values untill you get good results
          startDelay: 300,
          typeSpeed: 100,
          backSpeed: 100,
          backDelay: 100
        });
    
        // Destropying
        return () => {
          typed.destroy();
        };
      }, []);

    let x = -1;
    document.addEventListener('DOMContentLoaded', function(){
        Typed.new('#heading', {
        strings: ['Unable To FIND Objects??'],
        stringsElement: null,
        typeSpeed: 130,
        startDelay: 3000, 
        loop: true,
        showCursor: true,
        contentType: 'html',
    })});

  return (
    <>
    <div className="container">
        <img src={bg} alt="background" id="background"/>
        <div className="inner">
            <img src={bg1} alt="" id="bg1"/>
            <h1 id="heading">tr</h1>

            <form action="">
                <input type="text" name="user" id="user"/>
                <br/>
                <input type="password" name="pass" id="pass"/>
                <br/>
                <input type="submit" name="submit" id="submit" value="Find"/>
            </form>
        </div>
        
    </div>
    </>
  )
}

Home.propTypes = {

}

export default Home
